// スワイプを検知したあとの処理
function swipeEvent(direction) {
  if (direction == 'right'){
    location.href = "./page/picSelect.html";
  } else if (direction == 'left'){  
    location.href = "./page/camera.html";
  }
}

$(function(){
  $('a.thumbnail').on('click', function(){
    var selectPic = {};
    var pic = ''
    selectPic.pic = pic;
    selectPic.tag = ['#tag1','#tag2','#tag3','#tag4'];
    localStorage.setItem('selectPic', selectPic);
    location.href="./page/picDetail.html"
  });
});